    if n % 1 != 0:
        return "The number has a decimal part. No Results"
    def primefac(n):
        i = 2
        factors = []
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                factors.append(i)
        if n > 1:
            factors.append(n)
        return factors
    factors = primefac(n)
    if len(factors) == 1:
        return []
    prime_factors = []
    max_prime_factor = 0
    for factor in factors:
        if is_prime(factor):
            prime_factors.append(factor)
            if factor > max_prime_factor:
                max_prime_factor = factor
    divisor = 1
    for factor in reversed(factors):
        while n % factor == 0:
            divisor *= factor
            n //= factor
    if n > 1:
        divisor *= n
    return [max_prime_factor, divisor]

